import { makeStyles } from "@material-ui/core/styles";

export const useStyles = makeStyles((theme) => ({
	list: {
		height: "30vh",
		columnCount: 2,
		display: "flex",
		// flexWrap: "wrap",
		flexDirection: "row",
		// alignItems: "flex-start",
	},
	listItem: {
		verticalAlign: "top",
	},
	checkbox: {
		padding: 0,
	},
}));
